Legal Info
RPG Site is part of the Mist Network, and recognizes the importance of protecting the privacy of all information provided by users of rpgsite.net. We created the following policy guidelines with a fundamental respect for our users' right to privacy.
RPG Site uses reasonable precautions to keep the personal information disclosed to us secure and to disclose such information only to responsible third parties after permission from the user. RPG Site is not responsible for the content or the privacy policies of websites to which we may provide links or the websites of our affiliates or advertisers.
By using this site you agree to the terms and conditions and user agreement laid out below.
Copyright Terms
On RPG Site we cover many products that are copyright and trademark to other, larger companies. In all cases media of and pertaining to that game including screenshots, trailers and artwork remain copyright to the original respective owners, used by us under a fair use policy. 
We reserve full copyright of all original content we produce including content about those products such as reviews, articles and opinion.
Users who add comments or other content to the site should be aware that we reserve the rights to remove or modify any Content submitted for any reason without explanation. Requests for Content to be removed or modified will be undertaken only at our discretion. You are granting us with a non-exclusive, permanent, irrevocable, unlimited license to use, publish, or re-publish your Content in connection with the Service. You retain copyright over the Content.
Any issues or claims with regards to Copyright should be forwarded to us via our contact page.
Information Collected by Us
RPG Site collects information about users during their registration and during their participation in certain activities on our website, including contests. When users request pages from our server, our Web server automatically collects some information about the users, including their IP addresses. These addresses are used by computers on the network to send the requested pages to users.RPG Site does not reveal any personal information that users provide to us to any third party without their permission.
RPG Site uses users' IP addresses to help diagnose problems with our server and to administer our website. We also use it to gather broad demographic information about our users in general. We may combine demographic information supplied by a subscriber at registration with site usage data to provide profiles, in aggregate form, about our users and their preferences in the content of the site and advertising. We may share this composite information with our advertisers to help them better understand our services, but RPG Site does not give advertisers information about individual users.
RPG Site uses cookies to deliver content specific to users' interests and to honour their preferences. This information is used to assist us in creating a site that will serve the needs of our users.Although RPG Site does not specifically seek to obtain any information from children, there are certain areas of our website that children may visit. We urge children to only sign up for an RPG Site account after they have discussed it with their parents.
Advertising Information
RPG Site may use user entered information in combination with site usage information to help display advertisements relevant to the users interest and navigation patterns. RPG Site may use cookies to help in tracking these patterns but does not store or collect an personal data in combination with user supplied information.
We use third-party advertising companies to serve ads when you visit. These companies may use information (not including your name, address email address, telephone number or other specifically sensitive information) about your visits to this and other Web sites in order to provide advertisements about goods and services of interest to you.
Some advertising on this site is provided by Google, who use Cookies to Serve adverts to visiting users. Google makes use of a cookie called 'DART', which allows adverts to be targeted at users based on what websites they visit. This site uses the DART Cookie, and by browsing it you agree to use the cookie. You may opt out via Google's Network Privacy Policy.
Advertising Privacy Policy - Venatus Media
Last updated: May 2018

Please read our Privacy Notice carefully as it describes our collection, use, disclosure, retention and protection of your personal information. This notice applies to any website or service which references this Privacy Notice. Where you provide us with your personal information in any of the ways described in section 2 below, you agree that we may collect, store and use it (a) in order to perform our contractual obligations to you, (b) based on our legitimate interest for processing (i.e. for internal administrative purposes or for the detection or prevention of crime) or (c) based on your consent, which you may withdraw at any time, as described in this Privacy Notice.

Who we are - Our Privacy Notice applies to all products and services offered by Venatus Media Limited (a company incorporated in England with company registration number 07183957 and whose registered office address is 29-31 Saffron Hill, London, EC1N 8SW), but excludes any products or services that have separate privacy notices which do not incorporate this Privacy Notice.
How we collect information - To the extent permissible under applicable law, we collect information about you and any other party whose details you provide to us when you:
complete online forms, take part in surveys, enter any competitions or prize draws, download information such as white papers or other publications or participate in any other interactive areas that appear on our website;
interact with us using social media;
provide your contact details to us when accessing any websites or services we make available or when you update those details; and
contact us offline, for example by telephone, email or post.
We also collect information from your devices (including mobile devices) and browsers you use to access and use any of our websites or services (for example, we may collect the device identification number and type, location information and connection information such as statistics on your page views, traffic to and from the sites, referral URL, ad data, and your IP address) and we will ask for your permission before we do so. We may do this using cookies or similar technologies (as described in section 6 below).We may enhance personal information we collect from you with information we obtain from third parties that are entitled to share that information; for example, information from data management platforms, but in each case as permitted by applicable laws.If you intend giving us personal information about someone else, you are responsible for ensuring that you comply with any obligation and consent obligations under applicable data protections laws. In so far as required by applicable data protection laws, you must ensure that beforehand you have their explicit consent to do so and that you explain to them how we collect, use, disclose and retain their personal information or direct them to read our Privacy Notice.
How we use your information - To the extent permissible under applicable law, we use your information to:
provide any information and services that you have requested or services that you have ordered;
compare information for accuracy and to verify it with third parties;
provide, maintain, protect and improve any products, services and information that you have requested from us;
manage and administer your use of products and services you have asked us to provide;
manage our relationship with you (for example, customer services and support activities);
monitor, measure, improve and protect our content, website, and services and provide an enhanced, personal, user experience for you;
undertake internal testing of our website, systems and services to test and improve their security and performance. In these circumstances, we would anonymise any information used for such testing purposes;
provide you with any information that we are required to send you to comply with our regulatory or legal obligations;
detect, prevent, investigate or remediate, crime, illegal or prohibited activities or to otherwise protect our legal rights (including liaison with regulators and law enforcement agencies for these purposes);
contact you to see if you would like to take part in our customer research (for example, feedback on your use of our products and services);
to monitor, carry out statistical analysis and benchmarking, provided that in such circumstances it is on an aggregated basis which will not be linked back to you or any living individual;
deliver targeted advertising, marketing or information to you;
deliver joint content and services with third parties with whom you have a separate relationship (for example, social media providers); and
provide you with location based services (for example, advertising and other personalised content), where we collect geo-location data.
Our website, (including mobile applications) and services may contain technology that enables us to:
check specific information from your device or systems directly relevant to your use of the websites, or services against our records to make sure the websites, or services are being used in accordance with our end-user agreements and to troubleshoot any problems;
obtain information relating to any technical errors or other issues with our website and services;
collect information about how you and users use the functions of the features of our website and services; and
gather statistical information about the operating system and environment from which you access our applications or services.
You can manage your privacy settings within your browser or our website and services (where applicable).
In addition to the purposes described in this section 3, we may also use information we gather to deliver targeted advertising, marketing or information to you which may be useful, based on your use of the website or services or any other information we have about you (depending on the websites or services, you may able to configure these features to suit your preferences). Sections 5 and 6 of this Privacy Notice provides further details on how we will do this.We may monitor and record our communications with you, including e-mails and phone conversations. Information which we collect may then be used for training purposes, quality assurance, to record details about our website and services you order from us or ask us about, and in order to meet our legal and regulatory obligations generally.Mobile data: We may obtain information through mobile applications that you install on your mobile devices. These mobile applications may be our own mobile applications or those belonging to third parties. Where the mobile application belongs to a third party, you must read that third party’s own privacy notice as it will apply to your use of that third party mobile application. We are not responsible for such third party mobile applications and their use of your personal information.Mobile applications may provide us with information related to a user’s use of that mobile application and use of our applications and services accessed using that mobile application. We may use such information to provide and improve the mobile application or our own services. For example, activity undertaken within a mobile application may be logged.
Sharing your information - We may share your information with:
customer relationship management software to provide you with any information, products or services that you have requested;
our service providers and agents (including their sub-contractors) or third parties which process information on our behalf (e.g. internet service and platform providers, advertising agencies, agency trading desks, supply side platforms and data management platforms) so that they may help us to provide you with the products, services and information you have requested or which we believe is of interest to you;
partners, including website and mobile app publishers, resellers and developers that may help us to provide you with the products, services and information you have requested or which we believe is of interest to you;
third parties where you have a relationship with that third party and you have consented to us sending information (for example social media sites or other third party application providers);
third parties for marketing purposes (e.g. our partners and other third parties with whom we work and whose products or services we think will interest you);
credit reference and fraud prevention agencies;
law enforcement agencies so that they may detect or prevent crime or prosecute offenders;
any third party in the context of actual or threatened legal proceedings, provided we can do so lawfully (for example in response to a court order);
any third party in order to meet our legal and regulatory obligations, including statutory or regulatory reporting or the detection or prevention of unlawful acts;
our own professional advisors and auditors for the purpose of seeking professional advice or to meet our audit responsibilities;
another organisation if we sell or buy (or negotiate to sell or buy) any business or assets;
another organisation to whom we may transfer our agreement with you; and
Government departments where reporting is mandatory under applicable law.
We may share non-personally identifiable information about the use of our website, applications, products or services publicly or with third parties but this will not include information that can be used to identify you.
Marketing - From time to time, we may use your information to contact you with details about our products and services which we feel may be of interest to you. We may also share your information with other companies and carefully selected third parties so that they (or we) may contact you with information about their products or services which we feel may be of interest to you. You have the right at any time to stop us from contacting you for marketing purposes. You may also request at any time that we do not share your information with third parties referred to in this paragraph. If you wish to exercise these rights you can do so by selecting your contact preferences at the point where you provide us with your information on our websites or services, using any preference centres we give you access to or by sending us an email to [email protected] You can also unsubscribe from any email marketing using the links provided in the emails we send to you.
Your information and your rights - If you are based within the EEA or within another jurisdiction having similar data protection laws, in certain circumstances you have the following rights:
the right to be told how we use your information and obtain access to your information;
the right to have your information rectified or erased or place restrictions on processing your information;
the right to object to the processing of your information e.g. for direct marketing purposes;
the right to have any information you provided to us on an automated basis returned to you in a structured, commonly used and machine-readable format, or sent directly to another company, where technically feasible (“data portability”);
where the processing of your information is based on your consent, the right to withdraw that consent subject to legal or contractual restrictions;
the right to object to any decisions based on the automated processing of your personal data, including profiling; and
the right to lodge a complaint with the supervisory authority responsible for data protection matters (e.g. in the UK, the Information Commissioner’s Office).

If you request a copy of your information you may be required to pay a statutory fee. If we hold any information about you which is incorrect or if there are any changes to your details, please let us know by so that we can keep our records accurate and up to date.If you withdraw your consent to the use of your personal information for purposes set out in our Privacy Notice, we may not be able to provide you with access to all or parts of our website and services.We will retain your personal information for the duration of our business relationship and afterwards for as long as is necessary and relevant for our legitimate business purposes, in accordance with our data retention, marking and destruction policy or as otherwise permitted applicable laws and regulation. Where we no longer need your personal information, we will dispose of it in a secure manner (without further notice to you).
Changes to our privacy notice - We may change our Privacy Notice from time to time. However we will not reduce your rights under this Privacy Notice. We will always update this Privacy Notice on our website, so please try to read it when you visit the website (the ‘last updated’ reference tells you when we last updated our Privacy Notice).
Security and storage of information - We will keep your information secure by taking appropriate technical and organisational measures against its unauthorised or unlawful processing and against its accidental loss, destruction or damage. We will do our best to protect your personal information but we cannot guarantee the security of your information which is transmitted to our website or services or to other website, applications and services via an internet or similar connection. If we have given you (or you have chosen) a password to access certain areas of our websites or services please keep this password safe – we will not share this password with anyone.
If you believe your account has been compromised, please contact us at [email protected]
Transfers outside of the European Economic Area - Personal information in the European Union is protected by data protection laws but other countries do not necessarily protect your personal information in the same way.Our website and some of our applications or services or parts of them may also be hosted in the United States or otherwise outside of the EEA (which means all the EU countries plus Norway, Iceland and Liechtenstein) (“EEA”) and this means that we may transfer any information which is submitted by you through the website or the application or service outside the EEA to the United States or to other territories outside of the EEA. When you send an email to us, this will also be stored on email servers which are hosted with Google and therefore may be outside of the EEA.We may use service providers based outside of the EEA to help us provide our website and services to you and this means that we may transfer your information to service providers outside the EEA for the purpose of providing our advertising and services to you.We take steps to ensure that where your information is transferred outside of the EEA by our service providers and hosting providers, appropriate measures and controls are in place to protect that information in accordance with applicable data protection laws and regulations. In each case, such transfers are made in accordance with the requirements of Regulations (EU) 2016/679 (the General Data Protection Regulations or “GDPR”) and may be based on the use of the European Commission’s Standard Model Clauses for transfers of personal data outside the EEA.By using our website, products or services or by interacting with us in the ways described in this Privacy Notice, you consent to the transfer of your information outside the EEA in the circumstances set out in this Privacy Notice. If you do not want your information to be transferred outside the EEA you should not use our website, applications or services.
10. Other sites and social mediaIf you follow a link from our website or service to another site or service, this notice will no longer apply. We are not responsible for the information handling practices of third party sites or services and we encourage you to read the privacy notices appearing on those sites or services.Our websites or services may enable you to share information with social media sites, or use social media sites to create your account or to connect your social media account. Those social media sites may automatically provide us with access to certain personal information retained by them about you (for example any content you have viewed). You should be able to manage your privacy settings from within your own third party social media account(s) to manage what personal information you enable us to access from that account.
Cookies, Analytics and Traffic Data - Cookies are small text files which are transferred from our websites or services and stored on your device. We use cookies to help us provide you with a personalised service, and to help make our websites and services better for you.Our cookies may be session cookies (temporary cookies that identify and track users within our websites or services which are deleted when you close your browser or leave your session in the service) or persistent cookies (cookies which enable our websites or services to “remember” who you are and to remember your preferences within our websites or services and which will stay on your computer or device after you close your browser or leave your session in the application or service).We use the following different types of cookies:
Strictly necessary cookies - These are cookies which are needed for our websites or services to function properly, for example, these cookies allow you to access secure areas of our website.
Performance cookies and analytics technologies - These cookies collect information about how visitors and users use our websites, applications and services, for instance which functionality visitors use most often, and if they get error messages from areas of the websites, applications or services. These cookies don't collect information that identifies a visitor or user. All information these cookies collect is aggregated and therefore anonymous. We only use these cookies to improve how our website, applications and services work.
Targeting or advertising cookies - These cookies are used to deliver adverts more relevant to you and your interests. They are also used to limit the number of times you see an advertisement as well as help measure the effectiveness of the advertising campaign. They are usually placed by advertisers, advertising agencies or ad servicing technologies. They remember that you have visited a website and this information is shared with other organisations such as advertisers.
Web beacons and parameter tracking - We also use cookies and similar software known as web beacons to count users who have visited our website after clicking through from one of our advertisements on another website or in emails. These web beacons collect limited information which does not identify particular individuals. It is not possible to refuse the use of web beacons. However, because they are used in conjunction with cookies, you can effectively disable them by setting your browser to restrict or block cookies.
IP Address and traffic data - We keep a record of traffic data which is logged automatically by our servers (both our web site servers and our ad serving technologies), such as your Internet Protocol (IP) address, device information, the website that you visited before ours and the website you visit after leaving our site. We also collect some site and service statistics such as access rates and page views. We are not able to identify any individual from traffic data or site statistics.
How to disable cookies - You may be able to configure your browser or our website or the websites of our partners to restrict cookies or block all cookies if you wish, however if you disable cookies you may find this affects your ability to use certain parts of our website, or services. For more information about cookies and instructions on how to adjust your browser settings to accept, delete or reject cookies, see the www.youronlinechoices.co.uk website.  To change your cookie preferences you may be able to use our consent manager which can be found here.
Further information - If you have any queries about how we treat your information, the contents of this notice, your rights under local law, how to update your records or how to obtain a copy of the information that we hold about you, please write to our Data Protection Officer at Venatus Media Limited, 29-31 Saffron Hill, London, EC1N 8SWor send an email to [email protected]
